import { useState, useEffect } from 'react'
import "./Cars.css"
import CarInstance from './CarInstance'
import { fetch_data } from "../../utils/api";

interface Car {
    car_id: number;
    mark: string;
    category: string;
    price: number;
    transmission: string;
    status: string;
    image_path: string;
  }

export const Cars = () => {
    const [cars, setCars] = useState<Car[]>([]);


    useEffect(() => {
      getCars();
    }, []);

    const getCars = async () => {
      try {
        const response = await fetch('http://127.0.0.1:63341/car/getAll', {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${localStorage.getItem("access_token")}`
          }
        });
        const data = await response.json();
        setCars(data);
      } catch (error) {
        console.error(error);
      }
    };

    return (
        <div className="car-container my-4">
            <div className="row row-cols-3 gy-4 car-list" id="car-list">
                {cars.map((car, index) => (
                    <CarInstance
                        key={car.car_id}
                        strMark={car.mark}
                        strPrice={car.price.toString()}
                        strImagePath={car.image_path}
                    />
                ))}
            </div>
        </div>
    );
}
